import React from "react";
import { Link } from 'react-router-dom';
import './Nav.css';

const Nav = () => {
    return (
        <nav className='headerNav'>
            <h1 id='title-header'>Notice Board System</h1>
            <div id='container-btn-header'>
                <Link className='btn-header' to="/">HOME</Link>
                <Link className='btn-header' to="/board/1">BOARD</Link>
                <Link className='btn-header' to="/login">LOGIN</Link>
            </div>
        </nav>
    );
};

export default Nav;
